import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <ListSertifikat />
        <Route path="/listsertifikat/" exact component={Home} />
        <Route path="/about" component={About} />
        <Route path="/project" component={Project} />
      </div>
    </Router>
  );
}

export default App;
